import "../styles/footer.css";

function Footer() {
  return (
    <footer className="Footer">
      <p>&copy; <a href="https://github.com/lalandeau/101329235_comp3123_labtest2.git" target="_blank" rel="noreferrer"> Ellyn Bibon</a>
        </p>
    </footer>
  );
}

export default Footer;
